import React from 'react';
import Form from 'react-bootstrap/Form';
function CourseForm(){
    return(
          <div>
            <Form.Control
              type="text"
              placeholder="Disabled input"
              aria-label="Disabled input example"
              disabled
              readOnly
            />
            <br />
            <Form.Control
              type="text"
              placeholder="Disabled readonly input"
              aria-label="Disabled input example"
              readOnly
            />
          </div>
        );
      }
export default CourseForm;
